import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Navbar from './components/Navbar';
import Home from './components/Home';
import About from './components/About';
function App() {
  return (
    <>
   <Router>
    <Navbar></Navbar>
      <h1>This is inotebook</h1>
      <Home/>
      <Switch>
          <Route exact path="/about">
           <About/>
          </Route>

          <Route exact path="/">
            <Home />
          </Route>
        </Switch>
        </Router>
    </>
  );
}

export default App;
